script: |
  super -f text -I q6010.spq | sort > q6010.out

inputs:
  - name: q6010.spq
    data: |
      SELECT ALL col1 * 7 + + ( + - col1 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 * - - ( + 57 ) BETWEEN + col2 * + - col0 + + CAST ( + col0 AS REAL ) AND - 1;
  - name: tab1

outputs:
  - name: q6010.out
    data: |
